import { connect } from 'react-redux';
import SharePage from '../Component/sharePageScreen/index';
import {
  changeName,
  changeAge,
  initializeForm,
  requestData,
  receiveDataSuccess,
  receiveDataFailed,
} from '../Action/index';

const mapStateToProps = (state) => {
  console.log(state);
  return {
    store: state,
  };
};

const mapDispatchToProps = dispatch => ({
  changeName(nameText) {
    dispatch(changeName(nameText));
  },
  changeAge(ageText) {
    dispatch(changeAge(ageText));
  },
  initializeForm() {
    dispatch(initializeForm());
  },
  requestData() {
    dispatch(requestData());
  },
  receiveDataSuccess(characterArray) {
    dispatch(receiveDataSuccess(characterArray));
  },
  receiveDataFailed() {
    dispatch(receiveDataFailed());
  },
});


export default connect(mapStateToProps, mapDispatchToProps)(SharePage);
